import React, { useEffect, useState } from "react";
import imagenFondo from '../assets/images/mandalorian.jpg'; // imagen de la persona

function LastUserInDb() {

    const [lastUser, setLastUsers] = useState('');
    useEffect(() => {
        fetch('http://localhost:3030/API/users/list')
            .then(res => res.json())
            .then(data => setLastUsers(data.meta.count))
            .catch(e => console.log(e))
    }, [])
    let url = 'http://localhost:3030/API/users/' + lastUser;
    console.log(url)

    useEffect(() => {
        fetch('http://localhost:3030/API/users/' + { lastUser })
            // fetch(url)
            .then(res => res.json())
            .then(data => setLastUsers(data.data))
            .catch(e => console.log(e))
    }, [])

    return (
        <div className="col-lg-6 mb-4">
            <div className="card shadow mb-4">
                <div className="card-header py-3">
                    <h5 className="m-0 font-weight-bold text-gray-800">Ultimo usuario registrado</h5>
                </div>
                <div className="card-body">
                    {/*<  <img class="imagen-otros-libros"
                                src="/images/products/img-covey_los_7_habitos_de_la_gente_altamente_efectiva.jpg"
                                alt=" imÃ¡gen de libro Los 7 habitos de la gente altamente efectiva, de Covey">*/}
                    <div className="text-center">
                        <img className="img-fluid px-3 px-sm-4 mt-3 mb-4" style={{ width: 40 + 'rem' }} src={lastUser.imagen} />
                    </div>
                    <p>{lastUser.id}</p>
                    <p>{lastUser.nombre}</p>
                    <p>{lastUser.apellido}</p>
                    <p>{lastUser.domicilio}</p>


                    {/*<!-- Content Row Movies-->  <a className="btn btn-danger" target="_blank" rel="nofollow" href="/">View movie detail</a>*/}
                </div>
            </div>
        </div>
    )
}

export default LastUserInDb;
